import {createSlice} from '@reduxjs/toolkit';
import {DataOption} from "../Components/CSelect/props.type";

interface SelectState {
    options: Array<DataOption>,
    iconPosition: 'left' | 'right',
    example?: DataOption
}

const initialState:SelectState = {
    options: [
        {id: 1, value: 'education', active: false, icon: 'data:image/png;base64,'},
        {id: 2, value: 'sport', active: false, icon: 'data:image/png;base64,'},
        {id: 3, value: 'sience', active: false, icon: 'data:image/png;base64,'},
        {id: 4, value: 'art', active: false, icon: 'data:image/png;base64,'},
        {id: 5, value: 'music', active: false, icon: 'data:image/png;base64,'},
        {id: 7, value: 'games', active: false, icon: 'data:image/png;base64,'},
        {id: 8, value: 'movies', active: false, icon: 'data:image/png;base64,'},
        {id: 9, value: 'health', active: false, icon: 'data:image/png;base64,'},
    ],
    iconPosition: 'right',
    example: {id: 6, value: 'food', active: false, icon: 'data:image/png;base64,'}
};

const selectSlice = createSlice({
    name: 'select',
    initialState,
    reducers: {
        push: (state, action) => {
            const id = Date.now();
            state.options.push({...action.payload, id});
        },
        switchIconPosition: state => {
            state.iconPosition = state.iconPosition === 'left' ? 'right' : 'left';
        },
        selectOption: (state, action) => {
            state.options = state.options.map(option => {
                if(option.id === action.payload){
                    return {...option, active: !option.active};
                }
                return option;
            });
        },
        unselectAll: state => {
            state.options = state.options.map(option => {
                return {...option, active: false};
            });
        }
    }
});


export const { push, switchIconPosition, selectOption, unselectAll } = selectSlice.actions;
export default selectSlice.reducer;